import React, { Component } from 'react'
import './App.css'
import axios from 'axios'
import 'bootstrap/dist/css/bootstrap.min.css'
//import Button from 'react-bootstrap/Button';
//import { Button } from 'react-bootstrap';
//import PostForm from "./PostForm";
var QRCode = require('qrcode.react');

class App extends Component {
    constructor (probs) {
        super(probs)
        this.state = {
            invitation_url: '',
            invitation_url2:'',
        }

        this.handleClick = this.handleClick.bind(this)
        this.handleClick2 = this.handleClick2.bind(this)
    }

    handleClick () {
        console.log('Success!')
        axios.get('http://localhost:8000/getServiceLink').then(response => {
        console.log(response);
        console.log(response.data);
         this.setState({invitation_url: "http://192.168.2.102:8000/getInvitation"})});   
    }

    handleClick2 () {
      console.log('Success!')
      axios.get('http://localhost:9229/getServiceLink').then(response => {
      console.log(response);
      console.log(response.data);
       this.setState({invitation_url2: "http://192.168.2.102:9229/getInvitation"})});
    }

  render () {
    return (
            <div class="row" className="App">
              <header className="App-header">
              <h1>Routenplaner+</h1>
              <form class="Abstand">
                <label for="AStandort">Aktueller Standort:</label>
                <input name="APosition" id="AusgangsPosition" type="text" value="Hamburg Hauptbahnhof" />
                <br></br>
                <br></br>
                <label for="AStandort">Zieldestination:</label>
                <input name="ZPosition" id="ZielPosition" type="text" value="London Heathrow" />
                <input type="submit" value="Suchen"></input>
              </form>
              <h5 class="Abstand">Ergebnis:</h5>
              <div class="column">
                <h6>Streckenabschnitt 1 - Datum: 15.09.2021</h6>
                <h4>Verbindung Hamburg Hbf - Köln/Bonn Flughafen </h4>
                <h5>Abfahrtzeit 14:41 Uhr - Ankunftszeit 18:45 Uhr | Gleis 3</h5>
                <h5>Anbieter:</h5>
                <img src="https://logosmarken.com/wp-content/uploads/2021/03/Deutsche-Bahn-Logo.png" alt="" class="DBLogoIMG"></img>
                <img src="https://cdn-icons-png.flaticon.com/512/1532/1532079.png" alt="Zug - Kostenlose transport Icons" class="DBLogoIMG2"></img>
                  <button  type="button" className='button' onClick={this.handleClick}>Jetzt Zug buchen!</button>
                    <p class="p">Hier kann auf das Ticket zugegriffen werden:</p>
                    <a href="{this.state.invitation_url}">{this.state.invitation_url}</a>
                    <QRCode type="QR-Code" className="QR-Code" value={this.state.invitation_url}/>
              </div>

              <div class="column">
                  <h6>Streckenabschnitt 2 - Datum: 15.09.2021</h6>
                  <h4>Verbindung Köln/Bonn Flughafen - London Heathrow 19:45 Uhr</h4>
                  <h5>Abflugszeit 19:45 - Ankunftszeit 21:05 Uhr | Terminal 1</h5>
                  <h5>Anbieter:</h5>
                  <img src="https://logosmarken.com/wp-content/uploads/2020/11/Lufthansa-Logo.png" alt="" class="lufthansaIMG"></img>
                  <img src="https://cdn-icons-png.flaticon.com/512/61/61212.png" alt="Schwarzes flugzeug - Kostenlose transport Icons" class="lufthansaIMG2"></img>
                  <button  type="button" className='button' onClick={this.handleClick2}>Jetzt Flug buchen!</button>
                    <p class="p">Hier kann auf das Ticket zugegriffen werden:</p>
                    <a href="{this.state.invitation_url}">{this.state.invitation_url2}</a>
                    <QRCode type="QR-Code" className="QR-Code" value={this.state.invitation_url2}/>
                </div>
              </header>
            </div>
    )
  }
}
export default (App)
